import React from "react";

const NavBar = ({ onLogout }) => {
  return (
    <nav>
      <ul>
        <li><a href="/">Home</a></li>
        <li><a href="/profile">Profile</a></li>
        <li><a href="/reports">Create Reports</a></li>
        <li><button onClick={onLogout}>Logout</button></li>
      </ul>
     | Navbar bit|
    </nav>
  );
};

export default NavBar;
